import './style.css'
import Nav from '../Navbar'
//import Cards from '../Cards'
import Card from '../Cards/Card'
import Form from '../Form'

const App = () => {
  return (
    <div className="App">
      <Nav />
      <Form />
      <Card />
    </div>

  );
}

export default App;
